Chak De Phatte 2008
Punjabi movie




Plot

The story revolves around Simran (Mahi Gill) who is a Canadian NRI working as a manager at a local cafeteria in Chandigarh. JB (Jaswinder Bhalla), Goldy (Vivek Shauq), and Pinka Bhoond (Gurpreet Ghuggi), are three of the four main characters who chase Simran all through the movie. All three of them are more interested in Canada than in Simran. Smeep(Smeep Kang) on the other hand actually loves Simran from the deepness of his heart. He fell for her beauty since the time he saw her for the first time three years ago during Simran's hotel management course. Since then, he has lost track of her whereabouts, but he still keeps a greeting card that he had bought for her three years ago. Smeep and Goldy are roommates and live in Chandigarh as well.
